  let nx00 = lerp(d000, d100, u.x);
  let nx10 = lerp(d010, d110, u.x);
  let nx01 = lerp(d001, d101, u.x);
  let nx11 = lerp(d011, d111, u.x);

  let nxy0 = lerp(nx00, nx10, u.y);
  let nxy1 = lerp(nx01, nx11, u.y);

  return lerp(nxy0, nxy1, u.z);
